    console.log('====================================');
    return (
      <div style="position:relative">
        <div style={{float: "left", width: 50, height: 100, backgroundColor: "red"}}>Block1
        </div>
        <div style={{float: "left", width: 50, height: 100, backgroundColor: "yellow"}}>Block2
        </div>
        <div style={{float: "left", width: 50, height: 100, backgroundColor: "green"}}>Block3
        </div>
      </div>
    );
  }
}

export default Product;
